import logo from './logo.svg';
import './App.css';
import HeaderComponent from './components/header/header';

function App() {
  return (
    <div className="App">
      <div className="section header-section">
            <div className="section-container header-component">
              <HeaderComponent></HeaderComponent>
            </div>
          </div>
    </div>
  );
}

export default App;
